import React from "react";
import CreateCategory from "./CreateCategory";
import { ButtonStyled } from "../../common/Button/Button.styled";

export default function CategoryList({ category }) {
  return (
    <div>
      <CreateCategory>
        {category.categoryName.length
          ? category.categoryName.map(category => (
              <div key={category.categoryName.id}>
                <hr />
                <ButtonStyled buttonStyle={"danger"}>Delete</ButtonStyled>
                <ButtonStyled buttonStyle={"primary"}>Update</ButtonStyled>
              </div>
            ))
          : null}
      </CreateCategory>
    </div>
  );
}
